import { create } from "zustand";

export const useCounterStore = create(() => (
  { 
    number: 123,
    increaseCounterNumber: () => setImmediate((state) => ({number: state.number + 1})),
    decreaseCounterNumber: () => setImmediate((state) => ({number: state.number - 1}))
  }
));
